import React from 'react';

const Submitbtn = (props) => {


    return(
        <input
        className="w-80 b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6"
        type="submit" 
        value={props.value}
        onClick={props.onClick}
        >

        </input>
    )
}

export default Submitbtn;
